import React from "react";
import WithLabelExample from "./ProgressBar ";
import {} from "../img/Carouselstyle.css";
import Figure from "react-bootstrap/Figure";

const Testimotial = () => {
  return (
    <>
      <Figure>
        <Figure.Image
          width={171}
          height={180}
          alt="171x180"
          src="https://upload.wikimedia.org/wikipedia/commons/thumb/6/61/HTML5_logo_and_wordmark.svg/640px-HTML5_logo_and_wordmark.svg.png"
        />
        <Figure.Caption>
          HTML<WithLabelExample />
        </Figure.Caption>
      </Figure>

      <Figure>
        <Figure.Image
          width={171}
          height={180}
          alt="171x180"
          src="https://upload.wikimedia.org/wikipedia/commons/thumb/6/61/HTML5_logo_and_wordmark.svg/640px-HTML5_logo_and_wordmark.svg.png"
        />
        <Figure.Caption>
          HTML<WithLabelExample />
        </Figure.Caption>
      </Figure>
      <Figure>
        <Figure.Image
          width={171}
          height={180}
          alt="171x180"
          src="https://upload.wikimedia.org/wikipedia/commons/thumb/6/61/HTML5_logo_and_wordmark.svg/640px-HTML5_logo_and_wordmark.svg.png"
        />
        <Figure.Caption>
          HTML<WithLabelExample />
        </Figure.Caption>
      </Figure>
    </>
  );
};

export default Testimotial;
